import React from 'react';

import MenuBar from '../MenuBar'
import SideBar from '../SideBar'
import Main from '../Main';

import { Container, Wrapper} from './styles';

const Layout: React.FC = () => {
  return (
    <Container>
        <Wrapper>
            <MenuBar />
            <Main />
            <SideBar />
        </Wrapper>
    </Container>
  );
}

export default Layout;
